import React from 'react'

const Home = () => {
  return (
    <div> 
      <center>     
      <section id="titulo">
        <h2>Corta Caminho</h2>
      </section>
      <footer id="rodape">
        <p>Copyright &copy; 2021 - by Trumai Vilhena</p>
      </footer>
      </center>
    </div>
  );
}

export default Home
